import '../css/index.css'
import NightModePhoto from '../photos/night-mode.svg'

function HomePage() {
  return (
    <>
        <div className='wellcome-txt'>
            <span> 
            <h1>Dobrodosli na spaces.tk</h1>
            <h3>Vse za G 1. A in ostalo</h3><div></div>
            <div className="downArrow bounce">
                <button><img width="70" height="60" alt="" src="data:image/svg+xml;base64," /></button>
            </div>
            </span> 
        </div>
    </>
  );
}

export default HomePage;
